    def chp_predict(self):
        data = {"MedInc": float(self.lineEdit.text()), "HouseAge": float(self.lineEdit_2.text()),
                "AveRooms": float(self.lineEdit_3.text()), "AveBedrms": float(self.lineEdit_4.text()),
                "Population": float(self.lineEdit_5.text()), "AveOccup": float(self.lineEdit_6.text()),
                "Latitude": float(self.lineEdit_7.text()), "Longitude": float(self.lineEdit_8.text())}
        result = CHP_Prediction(data)
        msg=QMessageBox()
        # msg.setIcon(QMessageBox.critical)
        msg.setText("Result :")
        msg.setInformativeText(str(result))
        msg.setWindowTitle("Prediction Result")
        msg.exec()
        print(result)

